<!DOCTYPE html>
<html lang="ar">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>تسجيل طلب</title>
    <link href="https://fonts.googleapis.com/css2?family=Cairo:wght@400;700&display=swap" rel="stylesheet">
    <style>
        body {
            font-family: 'Cairo', sans-serif;
            direction: rtl;
            background-color: #f0f0f0;
            margin: 1;
            padding: 1;
        }
        .container {
            width: 80%;
            margin: 50px auto;
            padding: 20px;
            background-color: #fff;
            border-radius: 8px;
            box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);
        }
        h2 {
            text-align: center;
            color: #007bff;
        }
        label {
            display: block;
            margin-bottom: 8px;
            font-size: 16px;
            color: #007bff;
        }
        input[type="text"], input[type="number"], input[type="email"] {
            width: 100%;
            padding: 10px;
            margin-bottom: 20px;
            border: 1px solid #ccc;
            border-radius: 4px;
            box-sizing: border-box;
        }
        button {
            width: 100%;
            padding: 12px;
            background-color: #007bff;
            color: white;
            border: none;
            border-radius: 4px;
            font-size: 16px;
            cursor: pointer;
        }
        button:hover {
            background-color: #0056b3;
        }
        .message {
            text-align: center;
            font-size: 18px;
            margin-top: 20px;
        }
    </style>
</head>
<body>

<div class="container">
    <h2>تسجيل طلب</h2>
    <form id="requestForm">
        <label for="name">الاسم ثلاثي</label>
        <input type="text" id="name" name="name" required>

        <label for="age">السن</label>
        <input type="number" id="age" name="age" required>

        <label for="grade">الصف الدراسي / الكلية</label>
        <input type="text" id="grade" name="grade" required>

        <label for="address">العنوان</label>
        <input type="text" id="address" name="address" required>

        <label for="phone">رقم الهاتف (واتساب)</label>
        <input type="text" id="phone" name="phone" pattern="01[0-9]{9}" required>

        <label for="email">البريد الالكتروني (اختياري)</label>
        <input type="email" id="email" name="email">

        <button type="submit">إرسال الطلب</button>
    </form>
    <div class="message" id="message"></div>
</div>
